function converterFloatReal(valor){
  var inteiro = null, decimal = null, c = null, j = null;
  var aux = new Array();
  valor = ""+valor;
  c = valor.indexOf(".",0);
  //encontrou o ponto na string
  if(c > 0){
     //separa as partes em inteiro e decimal
     inteiro = valor.substring(0,c);
     decimal = valor.substring(c+1,valor.length);
     if(decimal.length === 1) {
		decimal += "0";
	  }
  }else{
     inteiro = valor;
  }
   
  //pega a parte inteiro de 3 em 3 partes
  for (j = inteiro.length, c = 0; j > 0; j-=3, c++){
     aux[c]=inteiro.substring(j-3,j);
  }
   
  //percorre a string acrescentando os pontos
  inteiro = "";
  for(c = aux.length-1; c >= 0; c--){
     inteiro += aux[c]+'.';
  }
  //retirando o ultimo ponto e finalizando a parte inteiro
   
  inteiro = inteiro.substring(0,inteiro.length-1);
   
  decimal = parseInt(decimal);
  if(isNaN(decimal)){
     decimal = "00";
  }else{
     decimal = ""+decimal;
     if(decimal.length === 1){
        decimal = "0"+decimal;
     }
  }
  valor = inteiro+","+decimal;
  return valor;
}

/**
* Gera um pdf
*
* @param dados
* @param dolumns
* @param autor
* @param solicitante
* @param titulo
* @param orientacao
* @param limitperpage
*/

function gerarPDF (dados, columns, autor, solicitante, titulo, orientacao, limitperpage, monetizar) {

	var addtext = (orientacao=="l")? "_____________________________________________" : "";

	var doc = new jsPDF(orientacao, 'pt');

	//Cabeçalho da página
    var header = function (data) {
        // Use http://dopiaza.org/tools/datauri/index.php to convert an image into image data
        var imgData = 'data:image/png;base64,';
        doc.addImage(imgData, 'JPEG', data.settings.margin.left, 20, 140, 72);

        doc.setFontSize(10);
        doc.autoTableText(String(data.pageCount), doc.internal.pageSize.width-data.settings.margin.right, 30, {valign:'middle', halign: 'right'});

        //Formato da data
        var date = new Date();
        var dia  = date.getDate();
        if (dia< 10) {
            dia  = "0" + dia;
        }
        var mes  = date.getMonth() + 1;
        if (mes < 10) {
            mes  = "0" + mes;
        }
        var ano  = date.getFullYear();
        dataFormatada = dia + "/" + mes + "/" + ano;

        doc.autoTableText("Escola: Centro Interescolar João Texeira Saraiva ", doc.internal.pageSize.width-data.settings.margin.right, 40, {valign: 'middle', halign: 'right'});
        if (solicitante) {
        	doc.autoTableText(solicitante, doc.internal.pageSize.width-data.settings.margin.right, 52, {valign: 'middle', halign: 'right'});
          doc.autoTableText("Série: 2º", doc.internal.pageSize.width-data.settings.margin.right, 65, {valign: 'middle', halign: 'right'});
          doc.autoTableText("Turma: A", doc.internal.pageSize.width-data.settings.margin.right, 77, {valign: 'middle', halign: 'right'});
          doc.autoTableText("Turno: Tarde", doc.internal.pageSize.width-data.settings.margin.right, 90, {valign: 'middle', halign: 'right'});
          //doc.autoTableText("Emitido em: "+ dataFormatada, doc.internal.pageSize.width-data.settings.margin.right, 100, {valign: 'middle', halign: 'right'});
        }
        if (autor) {
        	doc.autoTableText("Autor: "+autor, doc.internal.pageSize.width-data.settings.margin.right, 60, {valign: 'middle', halign: 'right'});
        }
        doc.setFontSize(14);
        
        doc.setFont("times");
		doc.setFontType("normal");
        //TITULO EM MAIÚSCULO
        doc.autoTableText(titulo.toUpperCase(), doc.internal.pageSize.width/2, 85, {valign: 'middle', halign: 'center'});
        //doc.text(titulo.toUpperCase(), doc.internal.pageSize.width/2 - (titulo.length*5), 85);
        doc.setFontSize(10);
    };

    //Rodapé da página
    var footer = function (data) {

        var str1 = "Prefeitura Municipal de Itapajé";
        var str2 = "Secretaria de Educação";
        var line = "_______________________________________________________________________________________________" + addtext;
        doc.setFontSize(10);
        doc.autoTableText(str1, doc.internal.pageSize.width/2, doc.internal.pageSize.height-30, {valign: 'middle', halign: 'center'});
        doc.autoTableText(str2, doc.internal.pageSize.width/2, doc.internal.pageSize.height-20, {valign: 'middle', halign: 'center'});
        doc.autoTableText(line, doc.internal.pageSize.width/2, doc.internal.pageSize.height-45, {valign: 'middle', halign: 'center'});
    };

 	var options = {
 		theme: 'grid', 
 		startY: 100, 
 		beforePageContent: header, 
 		afterPageContent: footer,
 		bodyStyles: {lineColor: 20, rowHeight: 12, fontSize: 8, valign: 'middle'},
 		headerStyles: {halign : 'center'},
 		createdCell: function (cell, data) {
            if (data.column.dataKey === monetizar) {
                cell.styles.halign = 'left';
                cell.text = 'R$ ' + converterFloatReal(cell.text);
            } else if (data.column.dataKey === 'country') {
                cell.text = cell.raw.split(' ')[0];
            }
        }
 	};

    doc.autoTable(columns, dados, options, limitperpage);//Geração da tabela 

    return doc;
}

function htmlToPdf(idelemento, autor, solicitante, titulo, orientacao){
    var pdf = new jsPDF(orientacao, 'pt')

    // source can be HTML-formatted string, or a reference
    // to an actual DOM element from which the text will be scraped.
    , source = $(idelemento)[0]

    // we support special element handlers. Register them with jQuery-style 
    // ID selector for either ID or node name. ("#iAmID", "div", "span" etc.)
    // There is no support for any other type of selectors 
    // (class, of compound) at this time.
    , specialElementHandlers = {
        // element with id of "bypass" - jQuery style selector
        '#bypassme': function(element, renderer){
            // true = "handled elsewhere, bypass text extraction"
            return true
        }
    }

    margins = {
      top: 80,
      bottom: 60,
      left: 40,
      width: 522
     };
     // all coords and widths are in jsPDF instance's declared units
     // 'inches' in this case
     pdf.fromHTML(
        source // HTML string or DOM elem ref.
        , margins.left // x coord
        , margins.top // y coord
        , {
            'width': margins.width // max width of content on PDF
            , 'elementHandlers': specialElementHandlers
        },
        function (dispose) {
          // dispose: object with X, Y of the last line add to the PDF 
          //          this allow the insertion of new lines after html
          pdf.save('Test.pdf');
        },
        margins
    )
    return pdf;
}